import React from 'react';
import {OverlayView} from '@react-google-maps/api'
export default function CustomMarker({features})
{
    const center = { lat: features.lat, lng: features.long }
    const [markerInfo,setInfo] = React.useState(false);
    return(
    <div>
        {markerInfo == true ? 
            <OverlayView
                position={center}
                mapPaneName={OverlayView.OVERLAY_MOUSE_TARGET}
>               <div className="marker">
                    <img src="https://cdn-icons-png.flaticon.com/512/684/684908.png" alt="" className="header-img"/>
                </div>
            </OverlayView> 
            : <div></div>}
    </div>
    )
}
